import React from 'react';

import SHOP_DATA from './shop-data';

class Shop extends React.Component {
  constructor(props) {
    super(props);

    this.state = SHOP_DATA;
  }

  render() {
    return <div>SHOP</div>
  }
}

export default Shop;
